+TextReplacements=(Category=Game, Namespace="", Key="5C2B5E41410BA965F35B8681A8593A99", NativeString="Delulu requires Voice Chat Set to \"EveryBody\" to play", LocalizedStrings=(("ar","يتطلب تشغيل Delulu تعيين الدردشة الصوتية على \"الجميع\""),("en","Delulu requires voice chat Set to \"EveryBody\" to play"),("de","Um Delulu spielen zu können, musst du die Sprach-Chat-Einstellung „Alle“ auswählen"),("es","Para poder jugar a Delulu, tienes que configurar el chat de voz y activar la opción \"Todo el mundo\"."),("es-419","Delulu requiere tener el chat de voz establecido en \"Todos\" para jugar"),("fr","Delulu nécessite que la discussion vocale soit réglée sur \"Tout le monde\" pour jouer."),("id","Delulu memerlukan obrolan suara Diatur ke \"Semua Orang\" agar bisa bermain"),("it","È necessario impostare la chat vocale su \"Tutti\" per giocare a Delulu"),("ja","Deluluをプレイするにはボイスチャットを「全員」に設定する必要があります"),("ko","Delulu는 플레이하려면 음성 채팅이 '모두'로 설정되어 있어야 합니다."),("pl","Delulu wymaga ustawienia czatu głosowego na „Wszyscy”, aby rozpocząć grę"),("pt-BR","O Delulu exige o bate-papo de voz definido como \"Todos\" para funcionar"),("ru","Для игры в Delulu необходимы настройки голосового чата «Все»"),("th","Delulu ต้องใช้การตั้งค่าการแชทเสียงเป็น \"ทุกคน\" จึงจะเล่นได้"),("tr","Delulu oynamak için sesli sohbet \"Herkes\" olarak ayarlanmalıdır"),("vi","Bạn cần Chuyển sang chế độ đàm thoại với \"Mọi Người\" để chơi Dự Án Delulu"),("zh-hans","游玩Delulu前，需将语音聊天设为“所有人”"),("zh-Hant","Delulu 需要將語音聊天設定為「所有人」才能遊玩")))
+TextReplacements=(Category=Game, Namespace="", Key="86F2E3D0436734A47D3FDDADF41AA240", NativeString="This game uses proximity voice chat to help you squad up with nearby players. Voice Chat must be set to <text color=\"#8AD6FF\" fontface=\"black\">Everybody</> in order to ready up.", LocalizedStrings=(("ar","تدعم هذه اللعبة الدردشة الصوتية عن قرب لمساعدتك على تكوين فريق مع اللاعبين القريبين. يجب تعيين الدردشة الصوتية على <text color=\"#8AD6FF\" fontface=\"black\">الجميع</> من أجل الاستعداد."),("en","This game uses proximity voice chat to help you squad up with nearby players. Voice Chat must be set to <text color=\"#8AD6FF\" fontface=\"black\">Everybody</> in order to ready up."),("de","Dieses Spiel verwendet Proximity-Sprach-Chat, um dir dabei zu helfen, mit Spielern in der Nähe ein Team zu bilden. Mach dich bereit, indem du die Sprach-Chat-Einstellung <text color=\"#8AD6FF\" fontface=\"black\">Alle</> auswählst."),("es","Este juego usa el chat de voz por proximidad para que formes escuadrón con los jugadores cercanos. El chat de voz debe estar configurado como <text color=\"#8AD6FF\" fontface=\"black\">Todo el mundo</> para empezar la partida."),("es-419","Este juego usa chat de voz por proximidad para ayudarte a formar un escuadrón con jugadores cercanos. El chat de voz debe estar establecido en <text color=\"#8AD6FF\" fontface=\"black\">Todos</> para iniciar la partida."),("fr","Ce jeu utilise la discussion vocale de proximité pour vous permettre de faire équipe avec les joueurs proches. La discussion vocale doit être réglée sur <text color=\"#8AD6FF\" fontface=\"black\">Tout le monde</> pour permettre la préparation."),("id","Game ini menggunakan obrolan suara jarak dekat untuk membantumu membentuk skuad dengan pemain di sekitar. Obrolan Suara harus diatur ke <text color=\"#8AD6FF\" fontface=\"black\">Semua Orang</> agar bisa digunakan."),("it","Questo gioco utilizza la chat vocale di prossimità per consentirti di fare squadra con i giocatori nelle vicinanze. Per completare i preparativi, la chat vocale deve essere impostata su <text color=\"#8AD6FF\" fontface=\"black\">Tutti</>."),("ja","このゲームでは、近くにいるプレイヤーとスクワッドを組むのに便利な近接ボイスチャットを使用しています。そのため、ボイスチャットを<text color=\"#8AD6FF\" fontface=\"black\">「全員」</>に設定する必要があります。"),("ko","이 게임은 근처 플레이어들과 스쿼드를 형성할 수 있도록 근거리 음성 채팅을 사용합니다. 이를 이용하려면 음성 채팅이 반드시 <text color=\"#8AD6FF\" fontface=\"black\">모두</>로 설정되어야 합니다."),("pl","Gra wykorzystuje zbliżeniowy czat głosowy, dzięki któremu możesz łatwo łączyć się z graczami w pobliżu i wspólnie tworzyć drużyny. Czat głosowy musi być ustawiony na opcję <text color=\"#8AD6FF\" fontface=\"black\">Wszyscy</>, aby rozpocząć działanie."),("pt-BR","Este jogo usa bate-papo de voz por proximidade para te ajudar a formar equipes com jogadores próximos. O bate-papo de voz precisa estar configurado como <text color=\"#8AD6FF\" fontface=\"black\">Todos</> para estar pronto."),("ru","В игре используется голосовой чат поблизости для объединения в отряды с игроками неподалёку. Настройки голосового чата должны быть выставлены на <text color=\"#8AD6FF\" fontface=\"black\">Все</>, чтобы быть готовыми к бою."),("th","เกมนี้ใช้แชทเสียงระยะใกล้เคียงเพื่อช่วยให้คุณพูดคุยกับผู้เล่นที่อยู่รอบข้างได้ ซึ่งต้องตั้งค่าแชทเสียงเป็น <text color=\"#8AD6FF\" fontface=\"black\">ทุกคน</>"),("tr","Bu oyun, yakındaki oyuncularla ekip olmana yardımcı olmak için uzaklığa duyarlı sesli sohbet kullanır. Hazırlanmak için sesli sohbet <text color=\"#8AD6FF\" fontface=\"black\">Herkes</> olarak ayarlanmalıdır."),("vi","Chế độ chơi này có tính năng đàm thoại cự ly gần để giúp bạn lập đội với những người chơi xung quanh bạn. Tính năng Đàm Thoại phải được đặt thành <text color=\"#8AD6FF\" fontface=\"black\">Mọi Người</> để bạn có thể sẵn sàng vào chơi."),("zh-hans","游戏支持临近语音聊天，让你更容易与周围玩家组队。语音聊天必须设置为<text color=\"#8AD6FF\" fontface=\"black\"> 所有人</> 才能准备就绪。"),("zh-Hant","本遊戲採用鄰近語音聊天功能，協助你與附近玩家組隊。語音聊天必須設定為<text color=\"#8AD6FF\" fontface=\"black\">所有人</>方可準備就緒。")))
+TextReplacements=(Category=Game, Namespace="", Key="16C43CE4403623BC609357BF5CE61D63", NativeString="Due to your age, the \"Everybody\" chat setting is not available. ", LocalizedStrings=(("ar","إعداد الدردشة \"الجميع\" ليس متاحًا لحسابك."),("en","The \"Everybody\" chat setting is not available for your account."),("de","Die Chat-Einstellung „Alle“ ist für deinen Account nicht verfügbar."),("es","El ajuste del chat \"Todo el mundo\" no está disponible para tu cuenta."),("es-419","El ajuste de chat \"Todos\" no está disponible para tu cuenta."),("fr","Le paramètre de discussion vocale \"Tout le monde\" n'est pas disponible sur votre compte."),("id","Pengaturan untuk obrolan \"Semua Orang\" tidak tersedia di akunmu."),("it","L'impostazione della chat \"Tutti\" non è disponibile per il tuo account."),("ja","「全員」チャット設定は、あなたのアカウントでは使用できません。"),("ko","이 계정은 '모두' 채팅 설정을 사용할 수 없습니다."),("pl","Ustawienie czatu „Wszyscy” nie jest dostępne na twoim koncie."),("pt-BR","A configuração de bate-papo \"Todos\" não está disponível para a sua conta."),("ru","Настройка чата «Все» недоступна для вашего аккаунта."),("th","บัญชีของคุณไม่สามารถตั้งค่าการแชทเป็น \"ทุกคน\" ได้"),("tr","\"Herkes\" sohbet ayarı hesabında kullanılamıyor."),("vi","Tài khoản của bạn không hỗ trợ chế độ cài đặt đàm thoại với \"Mọi Người\"."),("zh-hans","“所有人”聊天设置无法你的账号开启。"),("zh-Hant","你的帳號無法啟用「所有人」聊天設定。")))
+TextReplacements=(Category=Game, Namespace="", Key="601047E3496230D4223C4B8ACA4D3B80", NativeString="delulu Requires Voice CHat Set to \"EveryBody\" TO play", LocalizedStrings=(("ar","يتطلب تشغيل Delulu تعيين الدردشة الصوتية على \"الجميع\""),("en","Delulu requires voice chat set to \"Everybody\" to play"),("de","Um Delulu spielen zu können, musst du die Sprach-Chat-Einstellung „Alle“ auswählen"),("es","Para poder jugar a Delulu, tienes que configurar el chat de voz y activar la opción \"Todo el mundo\"."),("es-419","Delulu requiere tener el chat de voz establecido en \"Todos\" para jugar"),("fr","Delulu nécessite que la discussion vocale soit réglée sur \"Tout le monde\" pour jouer."),("id","Delulu memerlukan obrolan suara diatur ke \"Semua Orang\" agar bisa bermain"),("it","È necessario impostare la chat vocale su \"Tutti\" per giocare a Delulu"),("ja","Deluluをプレイするにはボイスチャットを「全員」に設定する必要があります"),("ko","Delulu는 플레이하려면 음성 채팅이 '모두'로 설정되어 있어야 합니다."),("pl","Delulu wymaga ustawienia czatu głosowego na „Wszyscy”, aby rozpocząć grę"),("pt-BR","O Delulu exige o bate-papo de voz definido como \"Todos\" para funcionar"),("ru","Для игры в Delulu необходимы настройки голосового чата «Все»"),("th","Delulu ต้องใช้การตั้งค่าการแชทเสียงเป็น \"ทุกคน\" จึงจะเล่นได้"),("tr","Delulu oynamak için sesli sohbet \"Herkes\" olarak ayarlanmalıdır"),("vi","Bạn cần chuyển sang chế độ đàm thoại với \"Mọi Người\" để có thể chơi Dự Án Delulu"),("zh-hans","游玩Delulu前，需将语音聊天设为“所有人”"),("zh-Hant","Delulu 需要將語音聊天設定為「所有人」才能遊玩")))
+TextReplacements=(Category=Game, Namespace="", Key="E156D2134D4C4AB597005C997C51208C", NativeString="This game uses proximity voice chat to help you squad up with nearby players. Voice Chat must be set to <text color=\"#8AD6FF\" fontface=\"black\">Everybody</> in order to ready up.", LocalizedStrings=(("ar","تدعم هذه اللعبة الدردشة الصوتية عن قرب لمساعدتك على تكوين فريق مع اللاعبين القريبين. يجب تعيين الدردشة الصوتية على <text color=\"#8AD6FF\" fontface=\"black\">الجميع</> من أجل الاستعداد."),("en","This game uses proximity voice chat to help you squad up with nearby players. Voice Chat must be set to <text color=\"#8AD6FF\" fontface=\"black\">Everybody</> in order to ready up."),("de","Dieses Spiel verwendet Proximity-Sprach-Chat, um dir dabei zu helfen, mit Spielern in der Nähe ein Team zu bilden. Mach dich bereit, indem du die Sprach-Chat-Einstellung <text color=\"#8AD6FF\" fontface=\"black\">Alle</> auswählst."),("es","Este juego usa el chat de voz por proximidad para que formes escuadrón con los jugadores cercanos. El chat de voz debe estar configurado como <text color=\"#8AD6FF\" fontface=\"black\">Todo el mundo</> para empezar la partida."),("es-419","Este juego usa chat de voz por proximidad para ayudarte a formar un escuadrón con jugadores cercanos. El chat de voz debe estar establecido en <text color=\"#8AD6FF\" fontface=\"black\">Todos</> para iniciar la partida."),("fr","Ce jeu utilise la discussion vocale de proximité pour vous permettre de faire équipe avec les joueurs proches. La discussion vocale doit être réglée sur <text color=\"#8AD6FF\" fontface=\"black\">Tout le monde</> pour permettre la préparation."),("id","Game ini menggunakan obrolan suara jarak dekat untuk membantumu membentuk skuad dengan pemain di sekitar. Obrolan Suara harus diatur ke <text color=\"#8AD6FF\" fontface=\"black\">Semua Orang</> agar bisa digunakan."),("it","Questo gioco utilizza la chat vocale di prossimità per consentirti di fare squadra con i giocatori nelle vicinanze. Per completare i preparativi, la chat vocale deve essere impostata su <text color=\"#8AD6FF\" fontface=\"black\">Tutti</>."),("ja","このゲームでは、近くにいるプレイヤーとスクワッドを組むのに便利な近接ボイスチャットを使用しています。そのため、ボイスチャットを<text color=\"#8AD6FF\" fontface=\"black\">「全員」</>に設定する必要があります。"),("ko","이 게임은 근처 플레이어들과 스쿼드를 형성할 수 있도록 근거리 음성 채팅을 사용합니다. 이를 이용하려면 음성 채팅이 반드시 <text color=\"#8AD6FF\" fontface=\"black\">모두</>로 설정되어야 합니다."),("pl","Gra wykorzystuje zbliżeniowy czat głosowy, dzięki któremu możesz łatwo łączyć się z graczami w pobliżu i wspólnie tworzyć drużyny. Czat głosowy musi być ustawiony na opcję <text color=\"#8AD6FF\" fontface=\"black\">Wszyscy</>, aby rozpocząć działanie."),("pt-BR","Este jogo usa bate-papo de voz por proximidade para te ajudar a formar equipes com jogadores próximos. O bate-papo de voz precisa estar configurado como <text color=\"#8AD6FF\" fontface=\"black\">Todos</> para estar pronto."),("ru","В игре используется голосовой чат поблизости для объединения в отряды с игроками неподалёку. Настройки голосового чата должны быть выставлены на <text color=\"#8AD6FF\" fontface=\"black\">Все</>, чтобы быть готовыми к бою."),("th","เกมนี้ใช้แชทเสียงระยะใกล้เคียงเพื่อช่วยให้คุณพูดคุยกับผู้เล่นที่อยู่รอบข้างได้ ซึ่งต้องตั้งค่าแชทเสียงเป็น <text color=\"#8AD6FF\" fontface=\"black\">ทุกคน</>"),("tr","Bu oyun, yakındaki oyuncularla ekip olmana yardımcı olmak için uzaklığa duyarlı sesli sohbet kullanır. Hazırlanmak için sesli sohbet <text color=\"#8AD6FF\" fontface=\"black\">Herkes</> olarak ayarlanmalıdır."),("vi","Chế độ chơi này có tính năng đàm thoại cự ly gần để giúp bạn lập đội với những người chơi xung quanh bạn. Tính năng Đàm Thoại phải được đặt thành <text color=\"#8AD6FF\" fontface=\"black\">Mọi Người</> để bạn có thể sẵn sàng vào chơi."),("zh-hans","游戏支持临近语音聊天，让你更容易与周围玩家组队。语音聊天必须设置为<text color=\"#8AD6FF\" fontface=\"black\"> 所有人</> 才能准备就绪。"),("zh-Hant","本遊戲採用鄰近語音聊天功能，協助你與附近玩家組隊。語音聊天必須設定為<text color=\"#8AD6FF\" fontface=\"black\">所有人</>方可準備就緒。")))
+TextReplacements=(Category=Game, Namespace="", Key="65777D4E4938AA43085B47A195EAEBFA", NativeString="\"Everybody\" voice chat requires your parent's permission. Your parent can finish your account set up or adjust your settings from the parental controls menu.", LocalizedStrings=(("ar","يتطلب تعيين الدردشة الصوتية على \"الجميع\" إذنًا من أحد الأبوين."),("en","\"Everybody\" voice chat requires your parent's permission."),("de","Für die Sprach-Chat-Einstellung „Alle“ benötigst du die Erlaubnis deiner Eltern."),("es","Necesitas el permiso de tus padres para activar la opción \"Todo el mundo\" del chat de voz."),("es-419","El ajuste \"Todos\" del chat de voz requiere el permiso de tu padre, madre o tutor legal."),("fr","Le paramètre de discussion vocale \"Tout le monde\" nécessite l'autorisation de vos parents."),("id","Obrolan suara \"Semua Orang\" memerlukan izin orang tuamu."),("it","L'impostazione della chat vocale \"Tutti\" richiede l'autorizzazione di un genitore."),("ja","ボイスチャットを「全員」に設定するには、保護者の許可が必要です。"),("ko","모두'와 음성 채팅을 하려면 보호자의 허락이 필요합니다."),("pl","Czat głosowy ustawiony na „Wszyscy” wymaga zgody rodziców."),("pt-BR","O bate-papo de voz \"Todos\" requer permissão do seu responsável."),("ru","Для включения настройки голосового чата «Все» требуется разрешение родителей."),("th","การแชทด้วยเสียงกับ \"ทุกคน\" ต้องได้รับอนุญาตจากผู้ปกครองของคุณ"),("tr","\"Herkes\" sesli sohbet ayarını kullanabilmen için ebeveyninin izni gerekir."),("vi","Để sử dụng chế độ đàm thoại với \"Mọi Người\", bạn cần có sự cho phép của phụ huynh."),("zh-hans","启用“所有人”语音聊天设置需获得家长许可。"),("zh-Hant","語音聊天的「所有人」設定需要家長的許可。")))
