+TextReplacements=(Category=Game, Namespace="", Key="6F753836480D33F335C9AAA670F53312", NativeString="Will you be the last player standing?", LocalizedStrings=(("ar","استخدم \"الإبلاغ عن المحادثة\" في الشريط الجانبي للإبلاغ عن سلوك بَدَر خلال دردشة صوتية يخالف قواعدنا لنتخذ الإجراء اللازم."),("en","Use \"Report Conversation\" in the sidebar to report voice chat behavior that violates our rules so we can take action. "),("de","Verwende „Unterhaltung melden" in der Seitenleiste, um Verhalten im Chat zu melden, das gegen unsere Regeln verstößt, damit wir etwas unternehmen können."),("es","Usa \"Informar sobre la conversación\" en la barra lateral para informar sobre un comportamiento del chat de voz que infrinja nuestras normas para que podamos tomar medidas."),("es-419","Usa \"Denunciar conversación\" en la barra lateral para denunciar un comportamiento del chat de voz que infrinja nuestro reglamento para que podamos tomar medidas."),("fr","Utilisez l'option \"Signaler la conversation\" dans la barre latérale pour signaler une discussion vocale qui enfreint notre règlement. Nous pourrons alors prendre les mesures qui s'imposent."),("id","Gunakan \"Laporkan Percakapan\" di bilah samping untuk melaporkan perilaku obrolan suara yang melanggar aturan, agar kami bisa mengambil tindakan."),("it","Usa \"Segnala conversazione\" nella barra laterale per segnalare comportamenti in chat vocale che violano le nostre regole, così potremo intervenire."),("ja","ボイスチャットの不適切な行為については、サイドバーの「通話を通報する」よりご報告ください。必要に応じて対処いたします。"),("ko","사이드바에서 \"대화 신고\"를 사용해 에픽이 조치를 취할 수 있도록 규정을 위반하는 음성 채팅 행위를 신고해 주세요."),("pl","Użyj funkcji \„Zgłoś rozmowę\" w pasku bocznym, by zgłosić zachowanie na czacie głosowym, które łamie nasze zasady. Dzięki temu będziemy w stanie zareagować."),("pt-BR","Use \"Denunciar Conversa\" na barra lateral para relatar comportamentos no bate-papo de voz que violem as nossas regras, para que possamos tomar providências."),("ru","Воспользуйтесь функцией «Пожаловаться на чат», представленной на боковой панели, чтобы сообщить о нарушении в голосовом чате."),("th","ใช้ \"รายงานการสนทนา\" ในแถบด้านข้างเพื่อรายงานพฤติกรรมการแชทเสียงที่ละเมิดกฎของเรา เพื่อให้เราดำเนินการต่อไป"),("tr","Yan menüdeki \"Sohbeti Şikâyet Et\" seçeneğini kullanarak kurallarımızı ihlal eden sesli sohbet mesajlarını raporlayabilirsin, böylece bu konuda eyleme geçebiliriz."),("vi","Sử dụng \"Báo Cáo Cuộc Trò Chuyện\" ở thanh bên để báo cáo hành vi đàm thoại vi phạm quy định của chúng tôi, chúng tôi sẽ có biện pháp xử lý phù hợp."),("zh-hans","使用侧边栏中的"举报对话"，举报违规语音聊天行为，我们将据此处理。"),("zh-Hant","使用側欄的 \"檢舉對話\" 功能檢舉違反規則的語音聊天行為，以便我們採取行動。")))
+TextReplacements=(Category=Game, Namespace="", Key="1FDDD46B471A63EFA60F82B988C994A1", NativeString="Betrayal - Inevitable", LocalizedStrings=(("ar","حافظ على روعته"),("en","Keep it Cool"),("de","Immer cool bleiben"),("es","No pierdas la calma"),("es-419","Mantén la calma"),("fr","Merci de rester correct"),("id","Tetap Tenang"),("it","Mantieni la calma"),("ja","冷静な対応を"),("ko","안내 사항"),("pl","Zachowajmy spokój"),("pt-BR","Fique numa Boa"),("ru","Дружелюбная атмосфера превыше всего"),("th","ใจเย็นๆ"),("tr","Sakin Ol"),("vi","Hãy Giữ Thái Độ Hòa Nhã"),("zh-hans","保持冷静"),("zh-Hant","保持禮貌")))
+TextReplacements=(Category=Game, Namespace="", Key="F9CD37274476D03F673E45814719B3B8", NativeString="Use \"Manage Party\" emotes to team up or leave.\r\n\r\nProximity chat lets you speak with nearby players.\r\n\r\nOnly one player will be declared the winner!", LocalizedStrings=(("ar","استخدم رقصات \"إدارة المجموعة\" للتعاون مع لاعبين آخرين أو المغادرة.\r\n\r\n تتيح لك الدردشة عن قرب محادثة اللاعبين القريبين.\r\n\r\n4 لاعبين فقط سيُتوجون بالفوز!"),("en","Use \"Manage Party\" emotes to team up or leave.\r\n\r\nProximity chat lets you speak with nearby players.\r\n\r\nOnly 4 players will be declared the winner!"),("de","Nutze \"Gruppe verwalten\"-Emotes, um dich einem Team anzuschließen oder eins zu verlassen.\r\n\r\nÜber den Proximity-Chat kannst du mit nahen Spielern sprechen.\r\n\r\nNur vier Spieler werden zum Sieger erklärt!"),("es","Usa gestos de \"Gestionar grupo\" para unirte a equipos o abandonarlos.\r\n\r\nEl chat de proximidad te permite hablar con los jugadores que haya a tu alrededor.\r\n\r\n¡Solo cuatro jugadores se alzarán con la victoria!"),("es-419","Usa los gestos de \"Gestionar grupo\" para formar un equipo o abandonar uno.\r\n\r\nEl chat de proximidad te permite hablar con los jugadores cercanos.\r\n\r\n¡Solo cuatro jugadores obtendrán la victoria!"),("fr","Utilisez les emotes de gestion de gestion du groupe pour faire équipe ou en partir.\r\n\r\nLa discussion de proximité vous permet de parler avec les joueurs proches.\r\n\r\nIl n'y aura que 4 vainqueurs !"),("id","Gunakan emot \"Kelola Kelompok\" untuk membentuk atau meninggalkan kelompok.\r\n\r\nObrolan jarak dekat memungkinkanmu berbicara dengan pemain di sekitarmu.\r\n\r\nHanya 4 pemain yang akan dinyatakan sebagai pemenang!"),("it","Usa le emote \"Gestisci gruppo\" per unirti alla squadra o abbandonarla.\r\n\r\nLa chat di prossimità ti permette di parlare con i giocatori vicini.\r\n\r\nSolo quattro giocatori saranno proclamati vincitori!"),("ja","「パーティー管理」のエモートを使ってパーティーを組んだり分かれたりしよう。\r\n\r\n近接ボイスチャットで近くにいるプレイヤーと話すことができるぞ。\r\n\r\n勝利を手にできるのは4人だけ！"),("ko","파티 관리' 이모트를 사용해 팀을 맺거나 팀에서 나가세요.\r\n\r\n근거리 채팅으로 근처의 플레이어와 대화할 수 있습니다.\r\n\r\n4명의 플레이어만 승자로 선언됩니다!"),("pl","Użyj emotki \"Zarządzaj ekipą\", aby grać razem lub wyjść z oddziału.\r\n\r\nZbliżeniowy czat głosowy umożliwia rozmowę z graczami w pobliżu.\r\n\r\nTylko 4 graczy może zwyciężyć!"),("pt-BR","Use os gestos de \"Gerenciar Grupo\" para formar uma equipe ou sair dela.\r\n\r\nO bate-papo por proximidade permite que você fale com o pessoal ao redor.\r\n\r\nApenas quatro pessoas serão declaradas vencedoras!"),("ru","Используйте эмоции управления группой, чтобы объединиться с игроками или покинуть отряд.\r\n\r\nРазговаривайте с находящимися рядом игроками в чате общения вблизи.\r\n\r\nПобедителями станут только 4 игрока!"),("th","ใช้อีโมต \"จัดการปาร์ตี้\" เพื่อเข้าทีมหรือออกจากทีม\r\n\r\nแชทระยะใกล้เคียง ทำให้คุณพูดคุยกับทุกคนที่อยู่รอบข้างได้\r\n\r\nมีเพียงผู้เล่น 4 คนเท่านั้นที่จะได้เป็นผู้ชนะ!"),("tr","Takım kurmak veya takımdan ayrılmak için \"Grubu Yönet\" ifadelerini kullan.\r\n\r\nYakınlığa duyarlı sohbet, yakınındaki oyuncularla konuşmana imkân sağlar.\r\n\r\nYalnızca 4 oyuncu kazanabilecek!"),("vi","Sử dụng động tác \"Quản Lý Tổ Đội\" để lập đội hoặc rời khỏi đội.\r\n\r\nTính năng Đàm Thoại Cự Li Gần cho phép bạn trò chuyện với người chơi ở xung quanh.\r\n\r\nChỉ có 4 người chơi được vinh danh chiến thắng!"),("zh-hans","使用\"管理队伍\"姿势来组队或离开聊天功能可让你与附近的玩家交谈。\r\n\r\n只有4名玩家会获得胜利！"),("zh-Hant","使用「管理組隊」表情動作來組隊或離隊。\r\n\r\n使用鄰近聊天與附近玩家交談。\r\n\r\n最終只有四名玩家能成為贏家！")))
+TextReplacements=(Category=Game, Namespace="", Key="2319BA6A48A25BDE4B30D0BFD5853D05", NativeString="Last Player Standing wins!", LocalizedStrings=(("ar","الفوز من نصيب آخر 4 لاعبين صامدين!"),("en","Last 4 Players Standing win!"),("de","Die letzten 4 überlebenden Spieler gewinnen!"),("es","¡Los últimos cuatro jugadores en pie ganan!"),("es-419","¡Los últimos cuatro jugadores en pie ganan!"),("fr","Les 4 derniers survivants l'emportent !"),("id","4 Pemain Terakhir yang Bertahan akan menang!"),("it","Gli ultimi quattro giocatori rimasti vincono!"),("ja","最後まで生き残ったプレイヤーが勝利！"),("ko","마지막까지 살아남은 4명의 플레이어가 승리합니다!"),("pl","Ostatni 4 pozostali gracze wygrywają!"),("pt-BR","As 4 últimas pessoas vencem!"),("ru","Побеждают четверо последних выживших!"),("th","ผู้เล่น 4 คนสุดท้ายที่รอดชีวิตจะชนะ!"),("tr","Hayatta kalan son 4 oyuncu kazanır!"),("vi","Bốn Người Chơi Cuối Cùng Còn Trụ Lại sẽ chiến thắng!"),("zh-hans","坚持到最后的4名玩家将获得胜利！"),("zh-Hant","存活到最後的四名玩家獲勝！")))
