+TextReplacements=(Category=Game, Namespace="", Key="03098EB647D25648E70A50A4A66C5FAF", NativeString="This Island belongs to us. \r\n\r\nArt by Anthony Francisco.", LocalizedStrings=(("ar","هذه جزيرتنا. \r\n\r\nعمل فني من إبداع Mike Norton."),("en","This Island belongs to us. \r\n\r\nArt by Mike Norton."),("de","Die Insel gehört uns. \r\n\r\nArt by Mike Norton."),("es","Esta isla es nuestra.\r\n\r\nIlustración de Mike Norton."),("es-419","¡Esta isla nos pertenece!I\r\n\r\nlustración de Mike Norton."),("fr","Cette île est à nous. \r\n\r\nIllustration par Mike Norton."),("id","Pulau ini milik kita. \r\n\r\nKarya seni Mike Norton."),("it","Quest'isola appartiene a noi. \r\n\r\nIllustrazione di Mike Norton."),("ja","この島は我々のものだ。\r\n\r\nMike Nortonによるアート。"),("ko","이 섬은 우리 거다. \r\n\r\n아트 제작자: Mike Norton"),("pl","Ta Wyspa jest nasza. \r\n\r\nStworzone przez: Mike Norton."),("pt-BR","Essa Ilha é nossa. \r\n\r\nArte por Mike Norton."),("ru","Помогайте защищать остров! \r\n\r\nАвтор: Mike Norton."),("th","เกาะแห่งนี้เป็นของพวกเรา\r\n\r\nภาพโดย Mike Norton"),("tr","Bu ada bizim!\r\n\r\nMike Norton'ın eseri."),("vi","Hòn Đảo này là của chúng ta. \r\n\r\nTác Phẩm Của Mike Norton."),("zh-hans","这个岛屿属于我们。 \r\n\r\n美术：Mike Norton。"),("zh-Hant","這座島嶼屬於我們。\r\n\r\nMike Norton 繪製。")))
+TextReplacements=(Category=Game, Namespace="", Key="99BEC8DD48E34F24122EB1AC80213853", NativeString="I couldn't do it without you! I'm talking to my robot arms. \r\n\r\nArt by Anthony Francisco.", LocalizedStrings=(("ar","لم أكن لأنجح دونكما! أتحدث إلى ذراعيّ الآليتين. \r\n\r\nعمل فني من إبداع Roc Espinet."),("en","I couldn't do it without you! I'm talking to my robot arms. \r\n\r\nArt by Roc Espinet."),("de","Ohne hätte es nicht geklappt! Ich spreche von meinen Roboterarmen. \r\n\r\nArt by Roc Espinet"),("es","¡No lo habría conseguido sin vosotros! Me refiero a mis brazos robóticos, claro.\r\n\r\nIlustración de Roc Espinet."),("es-419","¡No podría hacerlo sin ustedes! Estoy hablando con mis brazos robóticos.\r\n\r\nIlustración de Roc Espinet"),("fr","J'aurais rien pu faire sans vous ! Je parle à mes bras robots. \r\n\r\nIllustration par Roc Espinet."),("id","Tanpamu, tak mungkin aku berhasil! Aku sedang bicara dengan lengan robotku. \r\n\r\nKarya seni Roc Espinet."),("it","Come farei senza di voi? Sto parlando con le mie braccia robotiche. \r\n\r\nIllustrazione di Roc Espinet."),("ja","君なしじゃ無理だったよ！ 今のは私のロボットアームに言ったの。\r\n\r\nRoc Espinetによるアート。"),("ko","너 없이는 못 해냈을 거야! 내 로봇 팔한테 한 말이야. \r\n\r\n아트 제작자: Roc Espinet"),("pl","Bez was by się nie udało! Mówię do swoich roboramion. \r\n\r\nStworzone przez: Roc Espinet."),("pt-BR","Eu não teria conseguido sem vocês! Estou falando com meus braços robóticos. \r\n\r\nArte por Roc Espinet."),("ru","Без роботизированных рук ничего бы не получилось! \r\n\r\nАвтор: Roc Espinet."),("th","ฉันทำไม่ได้หากไม่มีคุณ! ฉันกำลังพูดกับแขนหุ่นยนต์ของฉัน\r\n\r\nภาพโดย Roc Espinet"),("tr","Bunu siz olmadan başaramazdım. Robot kollarıma dedim, size değil.\r\n\r\nRoc Espinet'in eseri."),("vi","Tôi không thể thành công nếu thiếu bạn! Tôi đang nói chuyện với cánh tay rô-bốt của mình. \r\n\r\nTác Phẩm Của Roc Espinet."),("zh-hans","没有你我是做不到的！啊？我在跟自己的机械臂说话。 \r\n\r\n美术：Roc Espinet。"),("zh-Hant","沒有你，我根本辦不到！我在跟我的機器手臂說話。\r\n\r\nRoc Espinet 繪製。")))
