+TextReplacements=(Category=Game, Namespace="", Key="9DE5BB624268FEAA6E91FC878FABA45C", NativeString="Sidekicks will react to the world around you. They won't detect any enemies or items though!\r\n\r\nIn Battle Royale, you can only see your team's Sidekicks. Visibility varies in other Fortnite experiences.", LocalizedStrings=(("ar","سيتفاعل المُرافقون مع العالم من حولك. لكنهم لن يرصدوا أي أعداء أو عناصر!\r\nفي باتل رويال، يمكنك رؤية مُرافقي فريقك فقط. تختلف درجة الوضوح في تجارب Fortnite الأخرى."),("en","Sidekicks will react to the world around you. They won't detect any enemies or items though!\r\nIn Battle Royale, you can only see your team's Sidekicks. Visibility varies in other Fortnite experiences."),("de","Begleiter reagieren auf die Welt um dich herum. Sie spüren jedoch weder Gegner noch Gegenstände auf!\r\nIn Battle Royale siehst du nur die Begleiter deines Teams. Die Sichtbarkeit variiert in anderen Fortnite-Erlebnissen."),("es","Los compañeros reaccionarán al mundo a tu alrededor, pero no detectarán a los enemigos ni los objetos.\r\nEn Battle Royale, solo verás a los compañeros de tu equipo. La visibilidad varía en otras experiencias de Fortnite."),("es-419","Los compañeros reaccionarán al mundo que te rodea. ¡Pero no detectarán enemigos ni objetos!\r\nEn Batalla campal, solo puedes ver a los compañeros de tu equipo. La visibilidad varía en otras experiencias de Fortnite."),("fr","Les mascottes réagissent à ce qui se passe autour de vous, mais elles ne détectent ni les adversaires ni les objets !\r\nDans Battle Royale, vous ne pouvez voir que les mascottes de votre équipe. Leur visibilité peut varier dans d'autres expériences de Fortnite."),("id","Maskot akan bereaksi terhadap dunia di sekitarmu. Namun, mereka tidak akan mendeteksi musuh atau item apa pun!\r\nDi Battle Royale, kamu hanya bisa melihat Maskot milik tim kamu. Visibilitas bervariasi dalam pengalaman bermain lain di Fortnite."),("it","Le mascotte reagiscono al mondo circostante. Non sono però in grado di individuare nemici o oggetti!\r\nIn modalità Battaglia reale puoi vedere solo le mascotte della tua squadra. Nelle altre esperienze di Fortnite la visibilità è variabile."),("ja","バディは周辺の環境に反応する。ただし、敵やアイテムは検知できないぞ！\r\nバトルロイヤルでは、チームメンバーのバディしか表示されない。なお、他のフォートナイトの体験では視認性が異なる場合があるぞ。"),("ko","사이드킥은 주변 세상에 반응합니다. 적과 아이템은 감지하지 않습니다!\r\n배틀로얄에서는 팀의 사이드킥만 볼 수 있습니다. 다른 포트나이트 경험에서도 표시되는지는 경험에 따라 다릅니다."),("pl","Druhowie będą reagować na otoczenie. Nie będą jednak wykrywać żadnych wrogów ani przedmiotów!\r\nW trybie Battle Royale będziesz widzieć tylko druhów ze swojej drużyny. Widoczność różni się w zależności od przygody w Fortnite."),("pt-BR","Mascotes reagirão ao mundo à sua volta. Mas não vão detectar inimigos ou itens!\r\nNo Battle Royale, você só pode ver Mascotes da sua equipe. A visibilidade varia em outras experiências do Fortnite."),("ru","Спутники реагируют на окружающий мир, однако обнаруживать врагов и предметы они не умеют.\r\nВ «Королевской битве» вы можете видеть спутников только своих союзников. В других форматах Fortnite может быть по-другому."),("th","คู่หูจะมีปฏิกิริยาต่อสิ่งรอบตัวคุณ แต่พวกเขาจะไม่ตรวจพบศัตรูหรือไอเทมใด ๆ หรอกนะ!\r\nในแบทเทิลรอยัล คุณจะเห็นได้เฉพาะคู่หูจากทีมของคุณเท่านั้น การมองเห็นจะแตกต่างกันไปในประสบการณ์ Fortnite อื่น ๆ"),("tr","Yoldaşlar etrafındaki dünyaya tepki verirler. Ancak düşmanları veya eşyaları tespit etmezler!\r\nBattle Royale'de yalnızca takımındaki yoldaşları görebilirsin. Görünürlük, başka Fortnite deneyimlerinde değişiklik gösterebilir."),("vi","Trợ Thủ sẽ phản ứng với thế giới xung quanh bạn. Tuy nhiên, chúng sẽ không phát hiện ra kẻ địch hoặc vật phẩm đâu nhé!\r\nTrong Cuộc Chiến Sinh Tồn, bạn chỉ có thể nhìn thấy Trợ Thủ của đội mình. Tầm nhìn sẽ thay đổi tùy theo các chế độ chơi Fortnite."),("zh-hans","搭档会对周围的世界做出反应，但无法探测敌人或物品！\r\n在大逃杀中，你只能看到自己队伍的搭档。其他Fortnite体验中的可见度各有不同。"),("zh-Hant","跟班對你周圍的世界會有反應，但不會偵測敵人或物品！\r\n在《大逃殺》，你只能看見隊伍的跟班。在其他 Fortnite 體驗中，可見性可能會不同。")))
