+TextReplacements=(Category=Game, Namespace="", Key="5EB6C1034C66CDBA48642A9EA899558E", NativeString="The first headshot damage will hit the Jebediah head. Once it flies off, it will be available to pick up again", LocalizedStrings=(("ar","ستصيب أول طلقة رأس جيبيدايا، لكنها ستكشف موقعك النسبي على الخريطة"),("en","The first headshot damage will hit the Jebediah head, but reveals your relative position on the map"),("de","Der erste Kopfschussschaden wird den Jebediah-Kopf treffen, dadurch wird jedoch deine relative Position auf der Karte markiert"),("es","La cabeza de Jebediah absorberá el primer disparo a la cabeza que recibas, pero también revelará tu posición relativa en el mapa"),("es-419","El primer disparo a la cabeza impacta en la cabeza de Jeremías Springfield, pero revela tu posición relativa en el mapa."),("fr","Les premiers dégâts à la tête touchent la tête de Jebediah mais révèlent votre position approximative sur la carte."),("id","Damage tembakan kepala pertama akan mengenai kepala Jebediah, tetapi juga mengungkap posisimu secara relatif di peta."),("it","Il primo danno da colpo alla testa colpirà la testa di Jebediah, ma rivelerà la tua posizione approssimativa sulla mappa"),("ja","最初のヘッドショットダメージはジェベダイアの頭が肩代わりするが、マップ上で自分の相対位置が判明してしまう"),("ko","첫 헤드샷 피해는 제버다이어의 머리를 맞힙니다. 하지만 맵에 자신의 상대적 위치가 표시됩니다"),("pl","Pierwsze trafienie w głowę uszkodzi głowę Jebediaha, ale ujawni twoją względną pozycję na mapie"),("pt-BR","O primeiro dano de acerto na cabeça atinge a cabeça do Jebediah, mas também revela a sua posição no mapa."),("ru","Первое попадание в голову достанется Джебедае, но ваше местоположение на карте станет видно всем."),("th","ความเสียหายเฮดช็อตครั้งแรกจะโดนหัวเจบีไดอาห์ แต่จะเปิดเผยตำแหน่งของคุณบนแผนที่"),("tr","Alınan ilk kafadan vuruş hasarı Jebediah'nın kafasına gelir ancak haritadaki göreceli konumunu açığa çıkarır."),("vi","Phát bắn trúng đầu lần đầu tiên sẽ gây sát thương vào đầu của Jebediah, nhưng sẽ để lộ vị trí tương đối của bạn trên bản đồ"),("zh-hans","第一次爆头伤害将命中杰贝迪亚的防护头盔，但会暴露你在地图上的相对位置。"),("zh-Hant","首次爆頭傷害會命中傑布帶伊的頭，但同時會在地圖上暴露你的相對位置")))
