+TextReplacements=(Category=Game, Namespace="Boombox", bIsMinimalPatch=True, Key="HearOtherPlayersBoomboxes_Name", NativeString="Hear Other Players' Jam Tracks", LocalizedStrings=(("ar","سماع مقطوعات عزف اللاعبين الآخرين"),("de","Jam-Songs anderer Spieler hören"),("es","Escuchar las pistas de improvisación de otros jugadores"),("es-419","Escuchar pistas de improvisación de otros jugadores"),("fr","Activer le son des pistes musicales des autres joueurs"),("id","Dengar Lagu Jamming Pemain Lain"),("it","Ascolta le tracce Jam di altri giocatori"),("ja","他のプレイヤーのジャムトラックを聞く"),("ko","다른 플레이어의 잼 트랙 듣기"),("pl","Słuchaj ścieżek jamowych innych graczy"),("pt-BR","Escutar as Músicas de Outros Jogadores"),("ru","Слушать джем-треки других игроков"),("th","ฟังแจมแทร็กของผู้เล่นคนอื่น"),("tr","Diğer Oyuncuların Müzik Parçalarını Duy"),("vi","Nghe Bản Nhạc Biến Tấu Của Những Người Chơi Khác"),("zh-hans","收听其他玩家的即兴曲目"),("zh-Hant","聆聽其他玩家的即興曲目")))
+TextReplacements=(Category=Game, Namespace="Boombox", bIsMinimalPatch=True, Key="HearOtherPlayersBoomboxes_Description", NativeString="Controls whether or not you will hear other players' Jam Tracks. This will not affect Jam Loops played by other players.", LocalizedStrings=(("ar","يتحكم في إمكانية سماع مقطوعات عزف اللاعبين الآخرين. لن يؤثر ذلك في حلقات العزف التي يشغلها لاعبون آخرون."),("de","Bestimmt, ob du die Jam-Songs anderer Spieler hören kannst. Dies wirkt sich nicht auf Jam Loops aus, die von anderen Spielern abgespielt werden."),("es","Determina si escuchas o no las pistas de improvisación de otros jugadores. No afecta a las improvisaciones que tocan los demás jugadores."),("es-419","Controla si escucharás las pistas de improvisación de otros jugadores. Esto no afectará a los bucles de improvisación que toquen otros jugadores."),("fr","Active ou désactive le son des pistes musicales des autres joueurs. Cette option n'affecte pas les boucles d'impro des autres joueurs."),("id","Mengatur apakah kamu akan mendengar Lagu Jamming pemain lain atau tidak. Ini tidak akan memengaruhi Loop Jamming yang diputar oleh pemain lain."),("it","Decidi se ascoltare o meno le tracce Jam di altri giocatori. Questo non influirà sulle tracce Jam riprodotte da altri giocatori."),("ja","他のプレイヤーのジャムトラックを聞くかどうか設定します。他のプレイヤーが再生するジャムセッションループには影響しません。"),("ko","다른 플레이어의 잼 트랙을 들을지를 설정합니다. 다른 플레이어가 연주하는 잼 루프에는 적용되지 않습니다."),("pl","Określa, czy będziesz słyszeć ścieżki jamowe innych graczy. Nie wpłynie to na pętle jamu odtwarzane przez innych graczy."),("pt-BR","Controla se você escuta ou não as Músicas de outros jogadores. Isso não afetará Loops de Improviso reproduzidos por outros jogadores."),("ru","Определяет, будете ли вы слышать джем-треки других игроков. Этот параметр не влияет на джем-партии, исполняемые другими игроками."),("th","ควบคุมว่าคุณจะได้ยินแจมแทร็กของผู้เล่นคนอื่นหรือไม่ การตั้งค่านี้จะไม่กระทบต่อแจมลูปที่ผู้เล่นอื่นเล่น"),("tr","Diğer oyuncuların müzik parçalarını duyup 