+TextReplacements=(Category=Game, Namespace="", Key="05E070154250DD2044B4849F56EC8B79", NativeString="Party up and complete the Winter Rush Quests in By Epic and Creator Made experiences to earn rewards until December 18th at 2:00amET. Some rewards may require gameplay in experiences rated Teen (or regional equivalent).", LocalizedStrings=(("ar","كوّن مجموعة وأكمل مهام تسارع الشتاء من تجارب \"بواسطة Epic\" وتجارب ابتكرها المبدعون لتكتسب المكافآت حتى 29 ديسمبر الساعة 10 صباحًا بتوقيت الرياض. تتطلب بعض المكافآت اللعب في تجارب اللعب المُصنفة للمراهقين (أو معادلها الإقليمي)."),("en","Party up and complete the Winter Rush Quests in By Epic and Creator Made experiences to earn rewards until November 29th at 2:00pm ET. Some rewards may require gameplay in experiences rated Teen (or regional equivalent)."),("de","Bilde mit anderen eine Gruppe und erledigt Winteransturm-Aufträge in Erlebnissen von Epic oder von Creators, um bis zum 29. November um 08:00 Uhr MEZ Belohnungen zu verdienen. Einige Belohnungen erfordern möglicherweise Gameplay in Erlebnissen, die als „Teen“ (oder einer ähnlichen regionalen Alterseinstufung) eingestuft wurden."),("es","Forma un grupo y completa las misiones de Avalancha invernal en experiencias de Epic y de creadores para conseguir recompensas hasta el 29 de noviembre a las 08:00 CET. Algunas recompensas pueden requerir jugar a experiencias clasificadas como \"Adolescentes\" (o su equivalente regional)."),("es-419","Forma un grupo y completa misiones de Avalancha invernal en experiencias \"Por Epic\" y de creadores para obtener recompensas hasta el 29 de noviembre a las 16:00 AR y 13:00 MX. Es posible que debas jugar en experiencias con una clasificación de T (adolescentes) o su equivalente regional para obtener algunas recompensas."),("fr","Faites équipe et accomplissez les quêtes de Charge hivernale dans les expériences Par Epic et conçues par des créateurs pour recevoir des récompenses jusqu'au 29 novembre à 20h (CET). Pour obtenir certaines récompenses, vous devrez peut-être jouer à des expériences dont la classification est Adolescents (ou autre équivalent régional)."),("id","Mainlah secara berkelompok dan selesaikan Quest Serbuan Musim Dingin di mode Buatan Epic dan Kreator untuk mendapat imbalan hingga tanggal 30 Des pukul 02:00 WIB. Beberapa imbalan akan memerlukan gameplay di pengalaman bermain dengan rating Remaja (atau yang setara di wilayahmu)."),("it","Fai gruppo e completa gli incarichi Corsa invernale (sia nelle esperienze di Epic, sia nelle esperienze progettate dai creatori): potrai ottenere ricompense fino al 29 novembre alle 20:00 ora italiana. Alcuni premi potrebbero richiedere il completamento di esperienze classificate Adolescenti (o equivalente regionale)."),("ja","パーティーを組み、Epicおよびクリエイター制作の体験でウィンターラッシュクエストをクリアし報酬を獲得しよう。期間は日本時間の11月30日午後4時まで。一部の報酬の獲得には、年齢評価が「Teen」の体験(または一部地域の同等のコンテンツ)で、ゲームプレイが必要な場合があります。"),("ko","11월 30일 오후 4시(한국 시간)까지 파티를 맺어 에픽 제작 및 크리에이터 제작 경험에서 겨울 질주 퀘스트를 완료해 보상을 받으세요. 일부 보상은 청소년 이용가 등급(또는 지역별로 상응하는 등급)의 경험에서 플레이해야 획득할 수 있습니다."),("pl","Do 29 listopada, godz. 20:00 czasu polskiego, zbierz ekipę i ukończ zadania Zimobicia w dziełach Epic i przygodach twórców, by otrzymać nagrody. Do odblokowania niektórych nagród może być konieczna gra w przygodach z kategorią wiekową Teen – dla nastolatków (lub odpowiednik w danym regionie)."),("pt-BR","Forme um grupo e conclua as Tarefas Febre de Inverno em experiências feitas por Criadores e pela Epic para ganhar recompensas até 29 de novembro, às 04h (BRT). Algumas recompensas podem precisar que se jogue em experiências com classificação para maiores de 12 anos (ou equivalente na sua região)."),("ru","Успейте получить награды: соберите отряд и выполните задания события «Зимняя тусовка» в играх из категории «От Epic Games» и на авторских островах до 29 ноября, 22:00 по московскому времени. Для получения некоторых наград может потребоваться сыграть в игры с возрастным рейтингом «Для подростков» (или аналогичным региональным рейтингом)."),("th","ตั้งปาร์ตี้แล้วทำเควสต์ฝ่าแดนหิมะให้สำเร็จในประสบการณ์ที่สร้างโดย Epic และสร้างโดยครีเอเตอร์ รับรางวัลได้จนถึง 29 พฤศจิกายน เวลา 02:00 น. ตามเวลาประเทศไทย รางวัลบางอย่างอาจต้องเล่นในประสบการณ์ที่จัดเรตไว้สำหรับวัยรุ่น (หรือเทียบเท่าในภูมิภาคนั้นๆ)"),("tr","Grup kurarak Epic Eseri ve içerik üreticisi eseri deneyimlerde Kış Telaşı görevlerini tamamla ve 29 Kasım TSİ 22.00'ye kadar ödüller kazan. Bazı ödülleri elde etmek için Genç (veya bölgendeki eşdeğeri) olarak derecelendirilmiş deneyimlerde oynaman gerekir."),("vi","Lập tổ đội và hoàn thành các Nhiệm Vụ Cơn Lốc Mùa Đông trong các chế độ chơi Từ Epic và Từ Người Sáng Tạo để nhận phần thưởng cho đến 14:00 ngày 29/11 theo giờ VN. Một vài phần thưởng có thể cần chơi ở những chế độ chơi được phân loại Thiếu Niên (hoặc tương đương tại khu vực)."),("zh-hans","北京时间11月30日凌晨3点前召集队伍，在Epic原创和创作者打造的体验中完成冬季冲刺任务，赢得丰厚奖励。部分奖励可能需要游玩青少年等级（或当地同类分级）内容才能获得。"),("zh-Hant","組隊並完成 Epic 製作和創作者製作體驗中的冬季狂潮任務，即可獲得獎勵，活動將於 11 月 30 日凌晨 3:00（台北時間）截止。部分獎勵只能在「青少年」分級（或當地同等分級）的體驗中獲得。")))
